import "./App.scss";
import Content from "./components/Content/Content";
import Navbar from "./components/Navbar/Navbar";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Search from "./components/Search/Search";
import { getMoviePage } from "./store/action";
import axios from "axios";
function App() {
  function movie(page) {
    fetch('https://api.apify.com/v2/key-value-stores/QubTry45OOCkTyohU/records/LATEST?fbclid=IwAR2KzHchOPaw4umcv5Ub244HJ2of22kuKcFdLWRGLfZtQnfv1qtlQup8urs')
    .then(res => res.json())
    .then(res => console.log(res))
  }
  movie()
  return (
    <div className="app">
      <Router>
        <Navbar />
        <Routes>
          <Route path="/" element={<Content />} />
          <Route path="/search" element={<Search />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
